import React from 'react'
import './style.css'
import { Link } from 'react-router-dom';
const Home = () => {
    return (
        <div className="home">
            <div className="title">
            <h1>
                <p>Hi,</p>
                <p>I am Swapnil</p>
                <p>Software Developer</p>
            </h1>
            <Link to="about">
                <button>More Info</button>
            </Link>
            </div>
            <div className="person">
            <img className="image"
                src={`${process.env.PUBLIC_URL}/profile.jpg`}
                alt="person picture" width="500" height="300"
            />
            </div>
        </div>

    );
};

export default Home;
